import React, { Component } from "react";


class CountDisplay extends Component {
    
    constructor(props) {
        super(props);

  }
      render() {
            return (
                  <>
                        <div className="CountDisplay">
                           <h1> 23 </h1> 
                            
                             <p> {this.props.Level} </p> 
                        
                        
                        </div>
                  </>
            );
      }
}

export default CountDisplay;
